import { SearchOutlined } from '@ant-design/icons';
import 'antd/dist/antd.min.css'
import { Button, message} from 'antd';
import React,{useState} from 'react'
import routes from '../../routes';
import { NavLink ,useRoutes } from 'react-router-dom';

export default function Home() {
  //根据路由表生成对应的路由规则
  const element=useRoutes(routes);
  const [software]=useState([
    {id:'001',desc:'软件描述1',type:'研发设计'},
    {id:'002',desc:'软件描述2',type:'信息管理'},
    {id:'003',desc:'软件描述3',type:'生产控制'},
    {id:'004',desc:'软件描述4',type:'嵌入式软件'}
  ])
  return (
    <div className="home">
      <div className="home-subnav">
        {message.map((m)=>{
          return (
            <ul className="home-subnav-left">
              {/* 路由链接 */}
              {/* all */}
              {/* infoManage */}
              {/* rdDesign */}
              {/* productControl */}
              {/* Firmware */}
              <li key={m.id}><NavLink to={`Contents/${m.id}/${m.desc}/${m.type}`}>{m.type}</NavLink></li>
          </ul>
          )
        })}
        <div className="home-subnav-right">
          <input type="text" placeholder='搜索'/>
          <Button shape="circle" icon={<SearchOutlined />} />
        </div>
      </div>
      {/* 注册路由 */}
      {element}
    </div>
  )
}
